    'link-projectsa-title':
      '/projectsa/%D8%B7%D8%A7%D9%82%D8%A9-%D8%A7%D9%84%D8%A8%D9%8A%D8%A6%D8%A9',
    class: 12,
    steps:
      '<h3 dir="RTL" class="font_3" style="text-align: right">كرة بناء نموذج "تحويل النفايات إلى طاقة بوتاجاز" باستخدام قطع ليغو:</h3>\n<ol class="font_8">\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>القاعدة الأساسية للنموذج</strong>:استخدم قطع ليغو كبيرة ومستطيلة لبناء قاعدة ثابتة للنموذج.<br>\nيمكن استخدام قطع ليغو ملونة لتوضيح كل جزء من أجزاء النظام (مثلاً، قطع باللون الأخضر للنفايات، وقطع باللون الأزرق للمياه).<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>مفاعلات التحلل</strong>:استخدم قطع ليغو شفافة أو قطع بألوان داكنة لتمثيل المفاعلات حيث تحدث عملية التحلل.<br>\nفي هذه المفاعلات، يمكن وضع قطع صغيرة تمثل النفايات العضوية.<br>\nيمكن تمثيل حركة النفايات داخل المفاعلات باستخدام قطع دوارة أو متحركة.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تخزين الغاز</strong>:استخدم قطع ليغو أسطوانية أو مستطيلة لبناء خزانات الغاز.<br>\nيمكن تمثيل الغاز باستخدام قطع ليغو صغيرة بيضاء أو شفافة، أو حتى أسهم تشير إلى تدفق الغاز.<br>\nتوصيل خزانات الغاز بأنابيب ليغو مرنة لتمثيل نقل الغاز.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>الأنابيب ونظام النقل</strong>:بناء أنابيب باستخدام قطع ليغو صغيرة مثل الأنابيب الملساء أو الأنابيب البلاستيكية للربط بين المفاعلات وخزانات الغاز.<br>\nيمكنك إنشاء مسار واضح للغاز باستخدام الأنابيب التي تربط بين المكونات المختلفة للنموذج.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>توضيح عملية التحلل</strong>:وضع أسهم أو قطع ليغو صغيرة ملونة لتمثيل التحلل البيولوجي للنفايات.<br>\nيمكن تحريك القطع الصغيرة لتمثيل عملية التحول.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>إضافة تفاصيل إضافية</strong>:يمكن إضافة شخصيات ليغو صغيرة لتمثيل العمال الذين يراقبون أو يديرون العملية.<br>\nاستخدم قطع ليغو إضافية لتمثيل الأدوات أو الأجهزة المساعدة في المراقبة أو الحماية.<br>\n</p></li>\n</ol>\n<h3 dir="RTL" class="font_3" style="text-align: right">كيفية البدء:</h3>\n<ul class="font_8">\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right">ابدأ ببناء القاعدة الأساسية للنموذج.</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right">قم بتصميم مفاعلات التحلل وخزانات الغاز.</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right">ربط المكونات باستخدام الأنابيب ليغو لتمثيل تدفق الغاز.</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right">أضف بعض الشخصيات لتوضيح النشاط البشري في المشروع.</p></li>\n</ul>',
